    "            ((metrics_baseline['RMSE'] - metrics_attention['RMSE']) / metrics_baseline['RMSE']) * 100,\n",
    "            ((metrics_baseline['MAE'] - metrics_attention['MAE']) / metrics_baseline['MAE']) * 100,\n",
    "            ((metrics_baseline['MAPE'] - metrics_attention['MAPE']) / metrics_baseline['MAPE']) * 100,\n",
