    "    \n",
    "    # 2. Hyperparameter tuning\n",
    "    print(\"\\nStep 2: Performing hyperparameter tuning...\")\n",
    "    train_loader_tune, val_loader_tune, _ = forecaster.create_data_loaders(\n",
    "        train_data, val_data, test_data, batch_size=32\n",
    "    )\n",
    "    \n",
    "    best_params = forecaster.hyperparameter_tuning(\n",
    "        train_loader_tune, val_loader_tune, input_dim\n",
    "    )\n",
    "    \n",
    "    # 3. Train models with best parameters\n",
    "    print(\"\\nStep 3: Training models...\")\n",
    "    \n",
    "    # Create final data loaders with best batch size\n",
    "    train_loader, val_loader, test_loader = forecaster.create_data_loaders(\n",
