    "    \n",
    "    # Attention-LSTM model\n",
    "    print(\"Training Attention-LSTM model...\")\n",
    "    attention_model = AttentionLSTM(\n",
    "        input_dim=input_dim,\n",
    "        hidden_dim=best_params.get('hidden_dim', 128),\n",
    "        output_dim=1,\n",
    "        num_layers=2,\n",
    "        attention_dim=64,\n",
    "        dropout=0.2\n",
    "    ).to(device)\n",
    "    \n",
    "    attention_model, train_losses_attention, val_losses_attention = forecaster.train_model(\n",
    "        attention_model, train_loader, val_loader,\n",
    "        num_epochs=100,\n",
    "        learning_rate=best_params.get('learning_rate', 0.001),\n",
    "        patience=10\n",
    "    )\n",
    "    \n",
    "    # Baseline LSTM model\n",
    "    print(\"Training Baseline LSTM model...\")\n",
