    "    plt.title(f'{model_name} + Attention: Actual vs Predicted')\n",
    "    plt.xlabel('Actual')\n",
    "    plt.ylabel('Predicted')\n",
    "    \n",
    "    # Plot 3: Scatter plot for baseline model\n",
    "    plt.subplot(2, 2, 3)\n",
    "    plt.scatter(actuals, predictions_baseline, alpha=0.5)\n",
    "    plt.plot([actuals.min(), actuals.max()], [actuals.min(), actuals.max()], 'r--', lw=2)\n",
    "    plt.title('Baseline LSTM: Actual vs Predicted')\n",
    "    plt.xlabel('Actual')\n",
    "    plt.ylabel('Predicted')\n",
    "    \n",
    "    # Plot 4: Residuals comparison\n",
    "    plt.subplot(2, 2, 4)\n",
    "    residuals_attention = actuals - predictions_attention\n",
    "    residuals_baseline = actuals - predictions_baseline\n",
    "    plt.hist(residuals_attention, alpha=0.7, bins=50, label=f'{model_name} + Attention')\n",
    "    plt.hist(residuals_baseline, alpha=0.7, bins=50, label='Baseline LSTM')\n",
    "    plt.title('Residuals Distribution')\n",
    "    plt.xlabel('Residuals')\n",
    "    plt.ylabel('Frequency')\n",
    "    plt.legend()\n",
    "    \n",
    "    plt.tight_layout()\n",
    "    plt.show()\n",
    "\n",
    "def plot_training_history(train_losses_attention, val_losses_attention, \n",
    "                         train_losses_baseline, val_losses_baseline):\n",
    "    \"\"\"Plot training history for both models\"\"\"\n",
    "    plt.figure(figsize=(12, 5))\n",
    "    \n",
    "    plt.subplot(1, 2, 1)\n",
    "    plt.plot(train_losses_attention, label='Attention-LSTM Train')\n",
    "    plt.plot(val_losses_attention, label='Attention-LSTM Val')\n",
    "    plt.title('Attention-LSTM Training History')\n",
    "    plt.xlabel('Epoch')\n",
    "    plt.ylabel('Loss')\n",
    "    plt.legend()\n",
    "    \n",
    "    plt.subplot(1, 2, 2)\n",
    "    plt.plot(train_losses_baseline, label='Baseline LSTM Train')\n",
    "    plt.plot(val_losses_baseline, label='Baseline LSTM Val')\n",
    "    plt.title('Baseline LSTM Training History')\n",
    "    plt.xlabel('Epoch')\n",
    "    plt.ylabel('Loss')\n",
    "    plt.legend()\n",
    "    \n",
    "    plt.tight_layout()\n",
    "    plt.show()\n",
    "\n",
    "def print_metrics_table(metrics_attention, metrics_baseline):\n",
    "    \"\"\"Print metrics comparison table\"\"\"\n",
    "    print(\"\\n\" + \"=\"*60)\n",
    "    print(\"COMPARATIVE PERFORMANCE ANALYSIS\")\n",
    "    print(\"=\"*60)\n",
